import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import {
  About,
  Home,
  Footer,
} from "./components";
import {Navbar} from "./Navbar";

function App() {
  return (
    <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
    </Routes>
    <Footer />
  </Router>
  );
}

export default App;
